import React from "react"
// set up routing
import { BrowserRouter as Router, Route, Redirect } from "react-router-dom"

import Users from "./user/pages/Users"

import './App.css';



function App() {
  return (
    <Router>
      {/* <div className="App">
        <h1>Let's Start</h1>
      </div> */}
      <Route path="/" exact>
        <Users />
      </Route>
      <Redirect to="/" />
    </Router>
  );
}

export default App;
